import React, { useState} from "react";

export default function CardGeneral() {

  const [filter, setFilter] = useState("")
  const filters = { "Gender": "gender", "Experience": "total_xp", "English Level": "english_level", "Company Location": "company_location", "Education Level": "education_level", "How did you learned coding?": "coding_learn"}

  const handleClickRadio = (e) => {
    setFilter(e.target.value);
  };

  return (
    <div className="card" style={{ width: 288}}>
      <div className="card-body">
        <h5 className="card-title text-center">FILTERS</h5>
        <div className="card-text">
          {Object.entries.map(value => (
              <div className="form-check" key={value}>
                <input className="form-check-input" type="radio" name="gridRadios" id="gridRadios2" value={value} />
                <label className="form-check-label" >
                {value}
              </label>
              </div>
            ))}
        </div>
      </div>
    </div>
  );
}
